import React, {Component} from 'react'
import Gauge from './Gauge.js'

class GaugeHolder extends Component {
    constructor(props) {
        super(props);
        this.state = {
            items: [],
            isLoaded: false,
        }
    }

    
}
export default GaugeHolder
